import React from "react";
import { StylesProvider } from "../context/NavBarStyleContext";
import styles from "../assets/styles/NavBar.css";

const NavBar = () => {
  return (
    <StylesProvider style={styles}>
      <div>NavBar</div>;
    </StylesProvider>
  );
};

export default NavBar;
